- proto: Paper
  entities:
  - uid: 206
    components:
    - type: Transform
      parent: 205
    - type: Paper
      content: Однажды меня вела дорога приключений..но в один день - мне прострелили колено.
    - type: Physics
      canCollide: False
    - type: InsideEntityStorage
  - uid: 334
    components:
    - type: MetaData
      name: Стих
    - type: Transform
      pos: 4.4693446,-8.638035
      parent: 1
    - type: Paper
      content: >
        Автор - Кайфас Фон Фауст


        В безмолвном космосе, среди звездных дали,

        Пират в корабле, что мечты уносили.

        Сквозь метеоры, сквозь кометы летя,

        Он искал искушений, спрятанных в светах.


        На щите из металла — родной флаг развевается,

        Затменья и вспышки — его душа разгорается.

        Светила мерцают, манят в глубину,

        Но он ищет сокровища, что в черном свете ждут.


        Буря в небе кружится, кометы воют,

        Звезды как кошельки, таинства сулят.

        Под парусами света, под шепот мечты,

        Он курит туман и собирает мечты.


        Где-то ждут затменья, открытые миры,

        В каждом новом космосе — незримые дары.

        Пират в бескрайности, бесстрашный герой,

        В поисках свободы и свою звезду — кой.


        Войско из астероидов, на свете не найти,

        Смел люди, как пираты, готовые сразиться.

        В космической одиссее, где просторы без конца,

        Пират их сердце вечно хранит в своих мечтах.
